import Layout from '../components/MyLayout';

export default function About() {
    return (
      <div>
         <Layout>
        <p>I'm a support engineer at SalesLoft, where I've been since July 2018.</p>

        <p>After undergrad at the University of California Irvine, I spent a few years in the private banking and nonprofit space. Last year, I finished a coding bootcamp.</p>

        <p>Outside of work, I'm a WomenWhoCode Atlanta Lead member, occasional blogger and conference speaker. I've also been contributing to open source Ruby projects to learn the language and its object oriented programming principles more deeply.</p>

        <a href="https://www.linkedin.com/in/abarrettdc/" target="_blank">Let's connect on LinkedIn!</a>
        </Layout>
      </div>
    );
}
